import { Table } from 'antd';
import React from 'react'

export default function ExamenManMusc({ examenes }) {

    const columns = [
        {
            title: 'grupo',
            dataIndex: 'grupo',
            key: 'grupo',
        },
        {
            title: 'referencia',
            dataIndex: 'referencia',
            key: 'referencia',
        },
        {
            title: 'dolor',
            dataIndex: 'dolor',
            key: 'dolor',
        },
        {
            title: 'dinamometro',
            dataIndex: 'dinamometro',
            key: 'dinamometro',
        },
    ];

    return <div>
        <p>Examen manual muscular</p>
        <Table columns={columns} dataSource={examenes} size='small' pagination={false}/>
    </div>
}
